import logo from './logo.svg';
import './App.css';

function Header() {
  return <header><h1><a href="/">React</a></h1></header>
}

function Nav() {
  return <nav>
    <ol>
      <li>html</li>
      <li>css</li>
      <li>js</li>  
    </ol>  
  </nav>
}

function App() {
  return (

    <div className="App">
      <Header></Header>
      <Nav></Nav>
    </div>
  );
}

export default App;
